import React from 'react'
import styled from 'styled-components'

const ThemeTogglerElement = styled.button`
  padding: .5rem 2rem;
  border-radius: 100px;
  border: 0;
  outline: 0;
  background: ${props => props.theme.base}
  border: 5px solid ${props => props.theme.accent}
`

export default function ThemeToggler (props) {
  <ThemeTogglerElement onClick={this.props.toggleMode} theme={props.theme}>
    I toggle themes
  </ThemeTogglerElement>
}
